import styled from "styled-components";

function MenuItems() {
  return (
    <MenuItemsContainer>
      <nav>
        <ul>
          <li>Item 1</li>
          <li>Item 2</li>
        </ul>
        <button>Cart</button>
      </nav>
    </MenuItemsContainer>
  );
}

export default MenuItems;

const MenuItemsContainer = styled.div`
  width: 50%;
  nav {
    display: flex;
    justify-content: flex-end;
    ul {
      display: flex;
      justify-content: space-between;
      align-items: flex-end;
      flex-wrap: wrap;
      color: white;
      list-style: none;

      li {
        text-align: center;
        padding: 0 2rem;
      }
